script: |
  super -f tsv -I q700.sql | sort > q700.out

vector: true

inputs:
  - name: q700.sql
    data: |
      SELECT DISTINCT cor0.col2 AS col2 FROM tab0 AS cor0 CROSS JOIN tab2 GROUP BY cor0.col2 HAVING NOT ( NULL ) IS NOT NULL;
  - name: tab0
  - name: tab2

outputs:
  - name: q700.out
    data: |
      24
      38
      79
